lc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2853368","type":"CustomJS"},{"attributes":{},"id":"2852979","type":"SaveTool"},{"attributes":{"coordinates":null,"data_source":{"id":"2852989"},"glyph":{"id":"2853347"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2853349"},"nonselection_glyph":{"id":"2853348"},"view":{"id":"2853351"}},"id":"2853350","type":"GlyphRenderer"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"2853261"}],"tooltips":[["Date","@datetime{%c}"],["x, y","$index\u00a0\u00a0\u00a0\u00a0$y{0,0.0[0000]}"],["OHLC","@Open{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@High{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@Low{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@Close{0,0.0[0000]}"],["Volume","@Volume{0,0}"],["aberration(H,L,C)","@{aberration(H,L,C)_0_1}{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@{aberration(H,L,C)_0_2}{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@{aberration(H,L,C)_0_3}{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@{aberration(H,L,C)_0_4}{0,0.0[0000]}"]]},"id":"2853366","type":"HoverTool"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"returns_positive","transform":{"id":"2852992"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"2853184","type":"Scatter"},{"at
